import React,{Component} from "react"

class QRStatis extends Component{
  render(){
    return(
      <div style = {containner}>

        <div style = {[box]}>
        <h1>test</h1>
        </div>


        <div style = {box}>
        <h1>test</h1>
        </div>

        <div style = {box}>
        <h1>test</h1>
        </div>

        <div style = {box}>
        <h1>test</h1>
        </div>

      </div>
    )
  }
}

const containner ={
  height:"100vh",
  display:'flex',
  flexDirection:'row',

}

const box = {
  backgroundColor :'skyblue',
  width:'18%',
  height:'11%',
  marginLeft:'auto',
  marginRight:'auto'
}

export default QRStatis;
